import React, { useState, useEffect } from 'react';
import { Tabs, Tab, AppBar } from "@material-ui/core";
import { Route, BrowserRouter, Switch, Link } from "react-router-dom";
import './Info_Navbar.css';
function Info_Navbar(props) {

  const routes = ["/", "/"];

  const RenderMenuInfo = () =>{

      return(
        <>
<BrowserRouter>
        <Route
          path="/profile"
          render={(history) => (
            <AppBar>
              <Tabs
                value={
                  history.location.pathname !== "/"
                    ? history.location.pathname
                    : false
                }
              >
                {console.log(history.location.pathname)}
                <Tab
                  value={routes[0]}
                  label="Vaccine History"
                  component={Link}
                  to={routes[0]}
                />
                <Tab
                  value={routes[1]}
                  label="Personal"
                  component={Link}
                  to={routes[1]}
                />
              </Tabs>
            </AppBar>
          )}
        />

        <Switch>
          <Route path="/" component={Books} />
          <Route path="/" component={Favorites} />
        </Switch>
      </BrowserRouter>

        <li className='info_nav-item'>
                 <Link  to='/profile' className='info_nav-links' onClick={closeMobileMenu}>
                 Vaccination History
                 </Link>
               </li>

        </>
      )
  }

  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);




  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);



  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);

  window.addEventListener('resize', showButton);

  return (
    <>
      <info_nav className='info_navbar'>
        <div className='info_navbar-container'>
          <div className='menu-icon' onClick={handleClick}>
            <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
          </div>
          <ul className={click ? 'info_nav-menu active' : 'info_nav-menu'}>

            <RenderMenuInfo/>

          </ul>
        </div>
      </info_nav>
    </>
  );
}

export default Info_Navbar;
